private static byte[][] pack(Long value) {
  if (value == null) {
    // OK: open ended range
    return new byte[1][];
  }
  byte[][] result = new byte[][] {new byte[RamUsageEstimator.NUM_BYTES_LONG]};
  BKDUtil.longToBytes(value, result[0], 0);
  return result;
}

